import React from "react";
import Data from '../../Data.js';
import Button from '../Utility/Button.jsx';
import Input from '../Utility/Input.jsx';

class coffeeOfTheDay extends React.Component {

  render() {
    return (
		<form action={Data.coffee.formspree} method="POST">
			<Input autocomplete="off" label="Name" />
			<Input autocomplete="off" label="Email" />
			<Input autocomplete="off" label="Message" textArea />
			<Button
				right
				submit
				text="Send Message"
			/>
      	</form>
    );
  }
}

export default coffeeOfTheDay;
